import React from 'react'
import styled from '@emotion/styled';

const quoteContainer = styled.div`
    padding: 3rem;
    border-radius: .5rem;
    background-color: #fff;
    max-width: 800px;
`


const Quote = ({quote}) => {
    return ( 
        <div>
            <h1>{quote.quote}</h1>
            <p>{quote.author}</p>
        </div>

     );
}

export default Quote;
